import React, { useState } from "react";

export default function RegisterPage() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");




  return (
    <div className="container">
      <div className="card card-body">
        <h1>Register</h1>
        <p>Register with your email and password</p>
        <form>
          <div className="mb-3">
            <label className="form-label">Email address</label>
            <input type="email" className="form-control" onChange={(e) => setEmail(e.target.value)}></input>
          </div>
          <div className="mb-3">
            <label className="form-label">Password</label>
            <input type="password" className="form-control" onChange={(e) => setEmail(e.target.value)}></input>
          </div>
          <div className="text-center">
            <button className="btn btn-primary px-5">Register</button>
          </div>
        </form>
      </div>
    </div>
  );
}
